(2356, 1, '2023-08-31 10:46:34', '2023-08-31 03:46:34', '<label> Your name\n    [text* your-name autocomplete:name] </label>\n\n<label> Your email\n    [email* your-email autocomplete:email] </label>\n\n<label> Tiêu đề:\n    [text* your-subject] </label>\n\n<label> Your message (không bắt buộc)\n    [textarea your-message] </label>\n\n[submit \"Gửi\"]\n[_site_title] \"[your-subject]\"\n[_site_title] <wordpress@congnghenangluc.test>\nGửi đến từ: [your-name] [your-email]\nTiêu đề: [your-subject]\n\nNội dung thông điệp:\n[your-message]\n\n-- \nEmail này được gửi đến từ form liên hệ của website [_site_title] ([_site_url])\n[_site_admin_email]\nReply-To: [your-email]\n\n0\n0\n\n[_site_title] \"[your-subject]\"\n[_site_title] <wordpress@congnghenangluc.test>\nNội dung thông điệp:\n[your-message]\n\n-- \nEmail này được gửi đến từ form liên hệ của website [_site_title] ([_site_url])\n[your-email]\nReply-To: [_site_admin_email]\n\n0\n0\nXin cảm ơn, form đã được gửi thành công.\nCó lỗi xảy ra trong quá trình gửi. Xin vui lòng thử lại hoặc liên hệ người quản trị website.\nCó một hoặc nhiều mục nhập có lỗi. Vui lòng kiểm tra và thử lại.\nCó lỗi xảy ra trong quá trình gửi. Xin vui lòng thử lại hoặc liên hệ người quản trị website.\nBạn phải chấp nhận điều khoản trước khi gửi form.\nVui lòng nhập dữ liệu cho trường này.\nTrường dữ liệu này có mục nhập quá dài.\nTrường dữ liệu có mục nhập quá ngắn.\nTải file lên không thành công.\nBạn không được phép tải lên file theo định dạng này.\nDung lượng file được tải lên quá lớn.\nTải file lên không thành công.', 'Form liên hệ 1', '', 'publish', 'closed', 'closed', '', 'form-lien-he-1', '', '', '2023-08-31 10:46:34', '2023-08-31 03:46:34', '', 0, 'https://pahlabs.test/?post_type=wpcf7_contact_form&p=2356', 0, 'wpcf7_contact_form', '', 0),
