(56, 'woocommerce-WCStripe-Aug-2023-security-updated', 'update', 'en_US', 'Security update of WooCommerce Stripe plugin', '<strong>Your store has been updated to the latest secure version of the WooCommerce Stripe plugin</strong>. This update was released on July 31.', '{}', 'pending', 'woocommerce.com', '2023-08-31 02:12:40', NULL, 0, 'plain', '', 0, 0, 'info'),
(57, 'woocommerce-WooPayments-Aug-2023-update-needed', 'update', 'en_US', 'Action required: Security update for WooPayments (WooCommerce Payments) plugin', '<strong>Your shop requires an important security update for the WooPayments (WooCommerce Payments) extension</strong>. The fix for this vulnerability was released on July 31. Please update immediately.', '{}', 'pending', 'woocommerce.com', '2023-08-31 02:12:40', NULL, 0, 'plain', '', 0, 0, 'info'),
(58, 'woocommerce-WooPayments-Aug-2023-security-updated', 'update', 'en_US', 'Security update of WooPayments (WooCommerce Payments) plugin', '<strong>Your store has been updated to the more secure version of WooPayments (WooCommerce Payments)</strong>. This update was released on July 31.', '{}', 'pending', 'woocommerce.com', '2023-08-31 02:12:40', NULL, 0, 'plain', '', 0, 0, 'info'),
(59, 'avalara_q3-2023_noAvaTax', 'marketing', 'en_US', 'Automatically calculate VAT in real time', 'Take the effort out of determining tax rates and sell confidently across borders with automated tax management from Avalara AvaTax— including built-in VAT calculation when you sell into or across the EU and UK. Save time and stay compliant when you let Avalara do the heavy lifting.', '{}', 'pending', 'woocommerce.com', '2023-08-31 02:12:40', NULL, 0, 'plain', '', 0, 0, 'info'),
(60, 'woo-activation-survey-blockers-22AUG23', 'info', 'en_US', 'How can we help you get that first sale?', 'Your feedback is vital. Please take a minute to share your experience of setting up your new store and whether anything is preventing you from making those first few sales. Together, we can make Woo even better!', '{}', 'unactioned', 'woocommerce.com', '2023-08-31 02:22:17', NULL, 0, 'plain', '', 0, 0, 'info'),
(61, 'wc-admin-choosing-a-theme', 'marketing', 'en_US', 'Choosing a theme?', 'Check out the themes that are compatible with WooCommerce and choose one aligned with your brand and business needs.', '{}', 'unactioned', 'woocommerce-admin', '2023-09-05 02:30:35', NULL, 0, 'plain', '', 0, 0, 'info'),
(62, 'wc-admin-customizing-product-catalog', 'info', 'en_US', 'How to customize your product catalog', 'You want your product catalog and images to look great and align with your brand. This guide will give you all the tips you need to get your products looking great in your store.', '{}', 'unactioned', 'woocommerce-admin', '2023-09-05 02:30:35', NULL, 0, 'plain', '', 0, 0, 'info'),
(63, 'wc-admin-launch-checklist', 'info', 'en_US', 'Bạn đã sẵn sàng để ra mắt cửa hàng của mình?', 'Để đảm bảo bạn không bao giờ có cảm giác chìm đắm \"mình đã quên điều gì\", chúng tôi đã tập hợp danh sách kiểm tra trước khi ra mắt cần thiết.', '{}', 'unactioned', 'woocommerce-admin', '2023-09-05 02:30:35', NULL, 0, 'plain', '', 0, 0, 'info'),
(64, 'wc-admin-mobile-app', 'info', 'en_US', 'Install Woo mobile app', 'Install the WooCommerce mobile app to manage orders, receive sales notifications, and view key metrics — wherever you are.', '{}', 'unactioned', 'woocommerce-admin', '2023-09-05 02:30:35', NULL, 0, 'plain', '', 0, 0, 'info'),
(65, 'wc-admin-onboarding-payments-reminder', 'info', 'en_US', 'Start accepting payments on your store!', 'Take payments with the provider that’s right for you - choose from 100+ payment gateways for WooCommerce.', '{}', 'unactioned', 'woocommerce-admin', '2023-09-05 02:30:35', NULL, 0, 'plain', '', 0, 0, 'info'),
(66, 'wc-admin-manage-orders-on-the-go', 'info', 'en_US', 'Quản lý đơn hàng của bạn khi đang di chuyển', 'Tìm kiếm đơn đặt hàng, thông tin khách hàng và xử lý hoàn tiền chỉ bằng một cú nhấp chuột với ứng dụng Woo.', '{}', 'unactioned', 'woocommerce-admin', '2024-04-01 03:03:30', NULL, 0, 'plain', '', 0, 0, 'info'),
(67, 'woocommerce-usermeta-Sept2023-productvendors', 'update', 'en_US', 'Your store requires a security update', '<strong>Your shop needs an update to address a vulnerability in WooCommerce.</strong> The fix was released on Sept 15. Please update WooCommerce to the latest version immediately. <a href=\"https://developer.woocommerce.com/2023/09/16/woocommerce-vulnerability-reintroduced-from-7-0-1/\" />Read our developer update</a> for more information.', '{}', 'pending', 'woocommerce.com', '2024-04-01 03:03:33', NULL, 0, 'plain', '', 0, 0, 'info'),
(68, 'woocommerce-STRIPE-Oct-2023-update-needed', 'update', 'en_US', 'Action required: Security update for WooCommerce Stripe Gateway', '<strong>Your shop requires a security update to address a vulnerability in the WooCommerce Stripe Gateway</strong>. The fix for this vulnerability was released on October 17. Please update immediately.', '{}', 'pending', 'woocommerce.com', '2024-04-01 03:03:33', NULL, 0, 'plain', '', 0, 0, 'info'),
(69, 'amazon-mcf-reviews-2023-12-07', 'marketing', 'en_US', 'Enjoying Amazon MCF for WooCommerce?', 'We\'re Never Settle, the developers behind Amazon MCF for WooCommerce, and would be deeply honored to have your review. Reviews help immensely as other users can learn how MCF can solve their needs too! Not happy or need help? Please reach out for support and we’d love to make things right!', '{}', 'pending', 'woocommerce.com', '2024-04-01 03:03:33', NULL, 0, 'plain', '', 0, 0, 'info'),
(70, 'remove_estimated_deposits_2024', 'marketing', 'en_US', 'Estimated deposits are going away', 'To provide more accurate deposit information and support the expansion of instant deposits, estimated deposit details will no longer be available in WooPayments. We recommend upgrading to the latest version of WooPayments for more detailed balance status information.', '{}', 'pending', 'woocommerce.com', '2024-04-01 03:03:33', NULL, 0, 'plain', '', 0, 0, 'info'),
(71, 'airwallex_q1_2024', 'marketing', 'en_US', 'Save big on foreign exchange (FX) fees', 'Boost your international sales by offering Apple Pay, Google Pay, and 60+ local payment methods with Airwallex. Save time and money by settling payments directly in USD, EUR, HKD, SGD, AUD, and more — without the extra FX fees. Simple, cost-effective, fast.', '{}', 'pending', 'woocommerce.com', '2024-04-01 03:03:33', NULL, 0, 'plain', '', 0, 0, 'info'),
(72, 'wc-update-db-reminder', 'update', 'en_US', 'đã update cơ sở dữ liệu', 'Dữ liệu WooCommerce đã được cập nhật thành công. Cảm ơn bạn đã sử dụng phiên bản mới nhất!', '{}', 'unactioned', 'woocommerce-core', '2024-07-18 04:45:40', NULL, 0, 'plain', '', 0, 0, 'info'),
(73, 'wc-admin-performance-on-mobile', 'info', 'en_US', 'Theo dõi hiệu suất cửa hàng của bạn trên thiết bị di động', 'Theo dõi doanh số và sản phẩm hoạt động hiệu quả cao của bạn bằng ứng dụng Woo.', '{}', 'unactioned', 'woocommerce-admin', '2024-07-18 04:45:54', NULL, 0, 'plain', '', 0, 0, 'info'),
(74, 'klaviyo_q4_2024', 'marketing', 'en_US', 'Need a marketing solution to help you sell more?', 'Over 13,000 brands use Klaviyo to grow faster. You can drive 46x ROI with their personalized email, SMS, forms, and product reviews. Start for free today.', '{}', 'pending', 'woocommerce.com', '2024-08-06 04:36:33', NULL, 0, 'plain', '', 0, 0, 'info'),
(75, 'wnww-recap-july', 'marketing', 'en_US', 'Powerful updates and upgrades in WooCommerce', 'Have you seen all the latest from Woo? Check out our recent roundup for a look at the newest features, extensions, and insights making WooCommerce perform better than ever.', '{}', 'pending', 'woocommerce.com', '2024-08-15 01:40:40', NULL, 0, 'plain', '', 0, 0, 'info'),
(76, 'wc-admin-edit-products-on-the-move', 'info', 'en_US', 'Chỉnh sửa sản phẩm khi di chuyển', 'Chỉnh sửa và tạo sản phẩm mới từ thiết bị di động của bạn bằng ứng dụng Woo', '{}', 'unactioned', 'woocommerce-admin', '2024-08-30 06:39:56', NULL, 0, 'plain', '', 0, 0, 'info'),
(77, 'stripe_securityupdate_q3_2024', 'update', 'en_US', 'Security update required for your Stripe extension', 'To continue securely accepting payments, you must update your Stripe extension to at least version 8.6, re-authenticate, and turn on the new checkout experience. Review the documentation for instructions on how to make the necessary changes from your WooCommerce dashboard.', '{}', 'pending', 'woocommerce.com', '2024-09-24 07:08:28', NULL, 0, 'plain', '', 0, 0, 'info'),
(78, 'sirt-woo-2024-11-xss-admin', 'update', 'en_US', 'An important update is required for WooCommerce', 'This update addresses a security vulnerability that could allow unauthorized access to administrative privileges on your site. <a href=\"https://developer.woocommerce.com/2024/12/03/woocommerce-9-4-3-and-woocommerce-9-3-4-available-now/\">Learn more</a>.\r\n<br><br>\r\n<strong>Please ensure your site is updated to the latest version to stay secure.</strong>', '{}', 'pending', 'woocommerce.com', '2024-12-04 08:02:09', NULL, 0, 'plain', '', 0, 0, 'info');
